class configParams:
	def __init__(self):
		self.fileName = "CONFIG.dat";
		self.NAME = "etas";
		self.DRIVER = "ES582.1";
		self.CHANNEL = "CAN:1"
		self.BAUDRATE = 500000;
		self.TIMEOUT_HEATER = 30;

	def initConstants(self):
		dictionary = {};

		with open(self.fileName, "r") as f:
			for riga in f:
				riga = riga.strip();
				arr = riga.split(";");

				for item in arr:
					tmp = item.split("=");
					print(tmp);
					dictionary[tmp[0]] = tmp[1];

		self.DRIVER = dictionary["DRIVER"];
		self.CHANNEL = dictionary["CHANNEL"];
		self.BAUDRATE = int(dictionary["BAUDRATE"]);

		#Massimo valore Ã¨ 30s
		if(int(dictionary["TIMEHEATER"]) <= 30):
			self.TIMEOUT_HEATER = int(dictionary["TIMEHEATER"]);

